// 1. 找到Andrius的ID
MATCH (a:person {firstname: "Andrius"}) 
RETURN a.id AS andrius_id

// 2. 使用Andrius的ID查找他认识的人的ID
MATCH (a:person {id: andrius_id})-[:knows]->(p:person)
RETURN p.id AS known_people_id

// 3. 使用认识的人的ID来获取他们的相关信息
MATCH (p:person {id: known_people_id})
RETURN p.gender, p.lastname, p.language, p.creationdate, p.locationip, p.id, p.browserused

